AIR DATE: 2014-11-14

EPISODE TITLE: Nazi Art Hoax, Hunger Strike, Skull in the Ashes

Summary:
Museums are where America displays its wondrous treasures of the past -- often strange and curious remnants of the momentous events that have shaped our history. Behind each artifact is yet another story to be told and secrets to be revealed -- tales brimming with scandal, mystery, murder and intrigue. 

Whether a diary from an Arctic exploration, a stone giant thought to be the remnant of a race of enormous people or a futuristic house that almost changed the world, iconic museum artifacts help us uncover who we are and what we've become. Each hour of this series will take viewers on a captivating, revealing and at times shocking tour of America's past

